import styles from "./Navbar.module.scss";
import classNames from "classnames/bind";
import React, { useState, useEffect } from "react";
import { Link, useHistory, useLocation } from "react-router-dom";
import { useDispatch, useSelector } from "react-redux";
import decode from "jwt-decode";
import * as actionType from "../../constants/actionTypes";
import globe from "~/assets/globe.svg";
import logo from "~/assets/logo.png";
import { changeLanguage } from "../../actions/language";
const cx = classNames.bind(styles);
function Navbar() {
  const [user, setUser] = useState(JSON.parse(localStorage.getItem("profile")));
  const dispatch = useDispatch();
  const location = useLocation();
  const history = useHistory();
  const isLanguageEnglish = useSelector((state) => state.language.isEnglish);
  const socket = useSelector((state) => state.socket.socket);

  const logout = () => {
    dispatch({ type: actionType.LOGOUT });
    history.push("/auth");
    setUser(null);
    socket.disconnect();
  };

  useEffect(() => {
    const token = user?.accessToken;
    if (token) {
      const decodedToken = decode(token);
      if (decodedToken.exp * 1000 < new Date().getTime()) {
        logout();
      }
    }
    setUser(JSON.parse(localStorage.getItem("profile")));
  }, [location]);
  return (
    <header>
      <nav className={styles.nav}>
        <div className={styles["menu-right"]}>
          <ul className={styles.nav__list}>
            <li className={styles["nav__list-logo"]}>
              <Link to="/" className={styles["logo-link"]}>
                <img src={logo} alt="logo" className={styles["logo-img"]} />
              </Link>
            </li>
            <li className={styles["nav__list-item"]}>
              About
              <ul className={styles["nav__list-item-drop"]}>
                <li>How it works</li>
                <li>Ways to play"</li>
              </ul>
            </li>
            <li className={styles["nav__list-item"]}>
              Study
              <ul className={styles["nav__list-item-drop"]}>
                <li>
                  <Link to="/quizes">Public quizes</Link>
                </li>
                <li>Test game</li>
              </ul>
            </li>
          </ul>
        </div>
        <div className={styles["menu-left"]}>
          <ul className={styles.nav__list}>
            <li className={styles["nav__list-item"]}>Contact</li>

            {user ? (
              <>
                <li className={styles["nav__list-item"]}>
                  <Link to="/games/joingame">Play</Link>
                </li>
                {user.result.userType === "Teacher" && (
                  <li className={styles["nav__list-item"]}>
                    <Link to="/myquizes">My Quizes</Link>
                  </li>
                )}
                <li className={styles["nav__list-item"]}>
                  {user.result.firstName}
                </li>
                <li onClick={logout} className={styles["nav__list-item"]}>
                  Log out
                </li>
              </>
            ) : (
              <Link to="/auth" className={styles["nav__list-item"]}>
                Log in
              </Link>
            )}
            <li className={styles["nav__list-item"]}>
              <img src={globe} alt="" />
              EN
              <ul className={styles["nav__list-item-drop"]}></ul>
            </li>
          </ul>
        </div>
      </nav>
    </header>
  );
}

export default Navbar;
